INSERT INTO tasks VALUES('ccaca243-24cf-4f44-b728-f72720dc86ea','TASK-025','Remove unused imports across test suite',replace('TypeScript compilation shows 20+ TS6133 warnings for unused imports across test files (vi, beforeEach, TestLevel, various type imports). While not blocking, these create noise and indicate code quality issues. Clean removal improves maintainability and reduces confusion.\n\n---\n**Retry Guidance:**\nAnalyze the error carefully and try a different approach.','\n',char(10)),'improvement','blocked',2,NULL,'default-task-list',NULL,'P1','medium',1,0,'build_agent',NULL,NULL,0,NULL,NULL,NULL,'["All TS6133 unused import warnings eliminated","Tests still pass after import removal","No actual usage of \"unused\" imports overlooked","TypeScript --noUnusedLocals check passes"]',NULL,NULL,NULL,NULL,'2026-02-06 12:03:45','2026-02-06 12:58:03',NULL,'2026-02-06 12:52:54');
INSERT INTO tasks VALUES('a07ef191-a9f7-4c25-a886-2c5027226038','TASK-026','Fix PRD service type mismatches in tests',replace('tests/task-agent/prd-service.test.ts has TS2353 error where ''description'' property is passed to CreatePrdInput but doesn''t exist in the type. This indicates a mismatch between test expectations and actual PRD service interface.\n\n---\n**Retry Guidance:**\nAnalyze the error carefully and try a different approach.','\n',char(10)),'bug','blocked',2,NULL,'default-task-list',NULL,'P1','medium',1,0,'build_agent',NULL,NULL,0,NULL,NULL,NULL,'["CreatePrdInput type matches actual PRD service implementation","Test updated to use correct property names","TypeScript compilation passes for prd-service.test.ts","PRD service tests pass successfully"]',NULL,NULL,NULL,NULL,'2026-02-06 12:03:47','2026-02-06 12:58:03',NULL,'2026-02-06 12:52:54');
INSERT INTO tasks VALUES('0db4f961-491f-4ad5-8acb-2ddf545d0103','TASK-027','Fix TaskTestService missing recordResult method',replace('The test suite expects a recordResult() method on TaskTestService but it''s not implemented. Based on observation #146, tests reveal this method is needed for recording test execution results. The RecordResultInput and RecordedResult types have been added to types/task-test.ts but the service method is missing.\n\n---\n**Retry Guidance:**\nAnalyze the error carefully and try a different approach.','\n',char(10)),'bug','pending_verification',1,NULL,'default-task-list',NULL,'P1','medium',1,0,'build_agent',NULL,NULL,0,NULL,NULL,NULL,'["recordResult(input: RecordResultInput) method implemented in TaskTestService","Method persists test results to appropriate database table","Method returns RecordedResult type with confirmation","Tests that call recordResult() pass successfully"]',NULL,NULL,NULL,NULL,'2026-02-06 12:03:49','2026-02-06 13:00:40',NULL,'2026-02-06 12:52:54');
INSERT INTO tasks VALUES('560b75b0-2863-436c-b239-949c8581bcfa','TASK-028','Fix python-producer-api.test.ts unknown type errors','tests/integration/observability/python-producer-api.test.ts has multiple TS2571 errors (lines 315, 342, 343, 378, 394) where API response objects are type ''unknown''. This is likely due to missing type assertions on fetch/API responses in the Python integration test suite.','bug','pending_verification',0,NULL,'default-task-list',NULL,'P2','medium',1,0,'build_agent',NULL,NULL,0,NULL,NULL,NULL,'["All TS2571 errors resolved with proper type assertions","TypeScript understands the shape of Python producer API responses","Tests pass successfully","No type safety compromised"]',NULL,NULL,NULL,NULL,'2026-02-06 12:03:51','2026-02-06 12:56:17',NULL,NULL);
INSERT INTO tasks VALUES('9d79ab15-054a-44c9-b5a1-e3bfce732e4a','TASK-029','Implement parent-harness Critical Gap #1 - Clarification Agent','According to CRITICAL_GAPS.md, the system needs a Clarification Agent that asks users questions when tasks are vague (like "make it faster"). This would use the QuestionEngine (once fixed) to generate and manage clarifying questions before task execution begins. This prevents wrong implementations from vague requirements.','feature','pending_verification',0,NULL,'default-task-list',NULL,'P2','medium',1,0,'build_agent',NULL,NULL,0,NULL,NULL,NULL,'["New clarification_agent implemented using Sonnet model","Agent triggers on new user-created tasks (bypass for agent-created)","Integrates with QuestionEngine to generate questions","User responses stored and used to refine task definition","Well-defined tasks enter queue after clarification complete"]',NULL,NULL,NULL,NULL,'2026-02-06 12:03:52','2026-02-06 12:56:44',NULL,NULL);
INSERT INTO tasks VALUES('98d384ae-8188-4dde-a8c1-e5e96ec5412a','TASK-030','Document TypeScript build error baseline and track progress','The codebase currently has 90+ TypeScript compilation errors. Create a baseline document tracking error counts by category (TS2339, TS6133, TS2571, etc.) and file, with a plan to systematically eliminate them. This helps prioritize fixes and measure progress.','documentation','pending_verification',0,NULL,'default-task-list',NULL,'P3','medium',1,0,'build_agent',NULL,NULL,0,NULL,NULL,NULL,'["TYPESCRIPT_ERRORS_BASELINE.md created in docs/ directory","Error counts by type and file documented","Priority order for fixes defined","Progress tracking mechanism established","Document updated as errors are resolved"]',NULL,NULL,NULL,NULL,'2026-02-06 12:03:54','2026-02-06 13:05:55',NULL,NULL);
INSERT INTO tasks VALUES('34bb65fc-0e8c-4852-ad5a-2cc31f969e93','TASK-031','Fix: Clean Up Test Configuration Version Mismatch',replace('QA verification failed for TASK-006.\n\nFailed checks:\n- TypeScript Compilation: npm error Missing script: "typecheck"\nnpm error\nnpm error To see a list of scripts, run:\nnpm error   npm run\nnpm error A complete log of this run can be found in: /home/ned-atanasovski/.npm/_logs/2026-02-06T12_02_31_819Z-debug-0.log\n\n- Tests: Command failed: npm test 2>&1 || echo "No test script"\n\n\nOriginal task: Fix version incompatibility in tests/unit/config/phase7-config.test.ts where tests use ''v1'' but system enforces ''v2''. Either update tests to v2 or make version backward compatible. This indicates config format changed without test updates.\n\n---\n**Retry Guidance:**\nAnalyze the error carefully and try a different approach.','\n',char(10)),'bug','blocked',1,NULL,'default-task-list',NULL,'P2','medium',1,0,'build_agent',NULL,NULL,0,NULL,NULL,NULL,'["All tests pass","Build succeeds","TypeScript compiles"]',NULL,NULL,NULL,NULL,'2026-02-06 12:04:45','2026-02-06 13:00:56',NULL,NULL);
INSERT INTO tasks VALUES('bb7b2110-c25f-4192-b593-9864cfd302d9','TASK-032','Extend sync command to parse development.md Q&A','Modify scripts/sync.ts to add parseQAFromMarkdown() function that extracts **Q:**/**A:** patterns from development.md files and calls classifyQuestionToId() to map questions to YAML IDs, then saves to idea_answers table via saveAnswer(). Include development.md in content hash calculation for staleness detection.','feature','pending_verification',0,NULL,'default-task-list',NULL,'P0','medium',1,0,'build_agent',NULL,NULL,0,NULL,1,NULL,'["parseQAFromMarkdown() function exists in sync.ts or new parser module","Function extracts Q&A pairs from **Q:**/**A:** format","classifyQuestionToId() maps questions to YAML question IDs","Answers saved to idea_answers table with ideaId, questionId, answer, source=''user''","development.md included in content hash for staleness"]',NULL,NULL,NULL,NULL,'2026-02-06 12:38:27','2026-02-06 12:47:14',NULL,NULL);
INSERT INTO tasks VALUES('74ddc6d2-f16c-4120-87e4-dc08952503cd','TASK-033','Implement formatProfileForCategory() for all evaluators','Create formatProfileForCategory() function in agents/specialized-evaluators.ts that returns category-relevant profile excerpts: feasibility→skills+time, market→network+connections, risk→runway+tolerance, fit→full profile. Replace line 306-309 empty string conditional with this function.','feature','pending_verification',0,NULL,'default-task-list',NULL,'P0','medium',1,0,'build_agent',NULL,NULL,0,NULL,1,NULL,'["formatProfileForCategory() function exists","Returns focused excerpts for feasibility (skills, time available)","Returns focused excerpts for market (industry connections, network)","Returns focused excerpts for risk (financial runway, risk tolerance)","Returns full profile for fit category"]',NULL,NULL,NULL,NULL,'2026-02-06 12:38:27','2026-02-06 12:48:58',NULL,NULL);
